    "store": {"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n    \n\n\n\n\n\n    new Tablesort(document.getElementById('coverage-table'));\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Dependencies\n    \n    \n        \n            @types/node : 14.14.19\n        \n            @typescript-eslint/eslint-plugin : 4.11.1\n        \n            @typescript-eslint/parser : 4.11.1\n        \n            command-line-args : ^5.1.1\n        \n            eslint : 7.17.0\n        \n            eslint-config-prettier : 7.1.0\n        \n            ts-node : 9.1.1\n        \n            update-notifier : 5.0.1\n        \n            typescript : 4.1.3\n    \n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nTranslationSummaryJS\nView a summary of missing translation files into a folder\nThis library will help you to find missing translation files into a folder docs\nOutput\n  \n\n\nHow to use\nInstall\nnpm i @translation-summary/core -gCreate translation-summary-config.js file.\nYou can config just the properties witch you need. \nmodule.exports = {\n    folderPath: './i18n',\n    filePattern: '_...md$',\n    filePatternForReplace: '_LANGUAGE.md',\n    fileExtension: '.md',\n    extractLanguage: (file) => {\n        return file.substring(file.length - 5, file.length - 3);\n    },\n    replaceExtension: (file, lang, pattern, fileExtension) => {\n        return file.replace(fileExtension, pattern.replace('LANGUAGE', lang));\n    },\n};Note: visit Avaliables options for more information\nRun ts command\ntranslation-summary --config translation-summary-config.jsor just\nts -c translation-summary-config.jsInstall plugin into your proyect\nnode (JS)\nconst ts = require('@translation-summary/core');\n\nconst helper = new ts.TranslationSummary();\nconst summary = helper.getSummary();\n\nconsole.table(summary);Show data in console\nimport { TranslationSummary } from './translation-summay';\n\nconst helper = new TranslationSummary();\nconst summary = helper.getSummary();\n\nconsole.table(summary);Result model\nexport interface FileSummary {\n    file: string;\n    [key: string]: string;\n}Options\nYou can define options for files, extensions and replace functions that the library need it.\nconst options = new Options();\n\noptions.folderPath = './docs';\noptions.filePattern = '_...md$';\noptions.filePatternForReplace = '_param.md';\noptions.fileExtension = '.md';\noptions.extractLanguage = (file: string): string => {\n    return file.substring(file.length - 5, file.length - 3);\n};\noptions.replaceExtension = (file: string, lang: string, pattern: string, fileExtension: string): string => {\n    return file.replace(fileExtension, pattern.replace('param', lang));\n};\n\nconst helper = new TranslationSummary(options);\nconst summary = helper.getSummary();Avaliables options\n\n\n\nOption\nDescription\nDefault\n\n\n\n\nfolderPath\nFolder where start to search docs files\n./docs\n\n\nfilePattern\nRegular expression as string used to find native files\n_...md$\n\n\nfilePatternForReplace\nRegular expression with a param string witch will be replaced be language key\n_param.md\n\n\nfileExtension\nFile extension for docs files (empty string will take all files)\n.md\n\n\nextractLanguage\nFunction that return a language from a filename (e: doc_en.md must return en)\n\n\n\nreplaceExtension\nFunction that replace a native filename for a especific language filename (e: doc.md must return doc_en.d)\n\n\n\n\nTroubleshooting\nSome libraries may you need to install globably\nts-node\nnpm i ts-node -gtsutils\nnpm i tsutils -gtypescript\nnpm i typescript -g\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
